import { createRoot,  } from 'react-dom/client';

const App = () => {
    return (
        <div>
            <View>
                <Text> This page introduces all parts of the Solarboat project for Knowledge Management.</Text>
            </View>
        </div>
    );
};

const root = createRoot(document.getElementById('react-app'));
root.render(<App />);
